INSERT INTO `fotodrucker` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (1, '../img/products/Fotodrucker/Liene Fotodrucker Smartphone.webp;', 'Liene Fotodrucker Smartphone', 'https://www.amazon.de/sspa/click?ie=UTF8&spc=MTo3NDY0NzU1NDg1NjY2MjoxNjY3MDY5ODYxOnNwX2F0ZjoyMDAzMDEwMzY5Mjc5ODo6MDo6&sp_csd=d2lkZ2V0TmFtZT1zcF9hdGY&url=%2FFotodrucker-Liene-Sofortbilddrucker-Tintenpatronen-Farbsublimationsdruck%2Fdp%2FB09M8FR46T%2Fref%3Dsr_1_1_sspa%3F__mk_de_DE%3D%25C3%2585M%25C3%2585%25C5%25BD%25C3%2595%25C3%2591%26crid%3D4OR4606GY8ZV%26keywords%3DLiene%2BFotodrucker%2BSmartphone%26qid%3D1667069861%26qu%3DeyJxc2MiOiIwLjYwIiwicXNhIjoiMC42NSIsInFzcCI6IjAuMDAifQ%253D%253D%26sprefix%3Dliene%2Bfotodrucker%252Caps%252C94%26sr%3D8-1-spons%26psc%3D1', '149,00', 4.4, 1315, 0, 'white;Liene;1.96 kg;Nein;Farbig;Farb-Thermosublimationsdrucker;Hannto Technology Co., Ltd.;USB, WLAN;1 ppm;1 ppm;【Professioneller Fotodruck in echten Farben】Liene Farbdrucker verwendet die Dreifach-Farbsublimationsdruck-Technologie und verfügt über die Xrite PANTONE-Farbzertifizierung. Der dreifache Farbdruckprozess auf dem10x15 cm Foto ist direkt sichtbar, was die vollfarbige HD-Qualität der Fotos garantiert. Beim Fotodruck deckt der Schutzfilm das Foto automatisch,was Fotos vor Verblassen,Fingerabdrücken,Oxidation und Wasser schützt. So bleiben Ihre Erinnerungen immer lebendig.|【Eingebautes WIFI, einfache Verbindung mit mehrerer Geräte】Liene WIFI Fotodrucker ist mit iOS &amp; Andriod Smartphone/PC/MAC kompatibel. Das innovative integrierte WIFI-Design des Sofortbilddruckers bietet eine stabile und schnelle Verbindung. Machen Sie sich keine Sorgen mehr um die komplizierten Internetbedingungen zu Hause. Sie können direkt ohne Internet oder APP drucken. Der Fotodrucker mit bis zu 5 Geräte gleichzeitig verbinden und drucken. Teilen Sie Fotos und Erinnerungen mit anderen!|【Weitere Funktionen in der Liene APP】Liene Photo APP ist kompatibel mit iOS und Android-System, durch die spezialisierte APP können Sie den Filter einstellen. Es gibt vier Arten von Rand zur Verfügung（randlos, umrandet, polaroid, und ohne Nachschneiden), mit denen Sie Ihre einzigartigen Momente individuell gestalten können. darüber hinaus können Sie auch ID-Fotos, Passfotos, etc. drucken, was bei der Arbeit oder sogar im Ausland auch nützlich sein kann!|【Humanisiertes Design】Sind Sie immer noch besorgt Papierstau, Mangel an Fotopapier oder Farbband? Der WIFI Fotodrucker wird mit 20 Stücke Sublimationspapier und einem Farbband geliefert. Die Papiergröße passt perfekt in den Druckeinlass und -auslass. Sie haben keine Sorgen mehr über Papierstau. Sie können auch den Druckprozess in der APP überprüfen, die Sie auch automatisch daran erinnert, dass das Farbband zur Neige geht, so machen Sie sich keine Ärger mehr über den Druck!|【Kundenservice immer online】Wenn Sie Fragen zu Liene Fotodrucker haben, wenden Sie sich bitte an unseren Kundenservice: liene.de@afterservice.vip, wir werden Ihnen innerhalb von 24 Stunden antworten. Wenn Sie die Liene APP verwenden, um den Multifunktion Fotodrucker zu bedienen, wird es detaillierte Anweisungen für Sie geben. Wenn irgendwelche Probleme auftreten, wird die APP Sie sofort informieren und Ihnen helfen, sie zu lösen. Machen Sie sich keine Sorgen um Probleme!');
INSERT INTO `fotodrucker` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (2, '../img/products/Fotodrucker/Hp Envy Inspire 7920e.webp;', 'Hp Envy Inspire 7920e', 'https://www.amazon.de/HP-Multifunktionsdrucker-Tintenstrahldrucker-Fotodruck-Probemonate/dp/B09KVDNB9P/ref=sr_1_1?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=16V28MTBSQ5YS&keywords=Hp+Envy+Inspire+7920e&qid=1667069868&qu=eyJxc2MiOiIxLjcxIiwicXNhIjoiMC45MiIsInFzcCI6IjAuODYifQ%3D%3D&sprefix=%2Caps%2C80&sr=8-1', '143,99', 4.3, 1251, 3, 'white;HP;8.12 kg;Farbig;Thermal;hp;Bluetooth;10 ppm;15 ppm;HP+: smartes Drucken ist da. Mit HP+ erhalten Sie 1 zusätzliches Jahr Herstellergarantie, 6 Probemonate Instant Ink inklusive und weitere Vorteile. Mehr Informationen in der Produktbeschreibung|HP Envy Inspire 7920e Multifunktionaler Tintenstrahldrucker, 4 farbig CMYK, Drucken, Scannen, Kopieren, Fotodruck, mit Autom. Dokumentenzuführung (35 Blatt), Duplex / Doppelseitiger Druck|Reibungsloser Druck hochwertiger Fotos und Dokumente, integrierte Fotopapierzuführung, automatische Dokumentenzuführung von 35 Seiten für zügige Scans und Kopien ohne manuelles eingreifen|HP Instant Ink: Mit HP Instant Ink müssen Sie sich keine Gedanken mehr um Ihre Tinte machen und sparen dabei Zeit, Nerven und bis zu 70% Tintenkosten. Inklusive 6 Probemonate zum Testen|HP Smart App – Drucken, Scannen und Kopieren direkt von ihrem Smarthphone über WLAN (Airprint, Wireless Direct), Nachhaltiges Design aus mehr als 45 % aus recyceltem Kunststoff|Druckgeschwindigkeit bis zu 15 S./Min (Schwarzweiß), bis zu 10 S./Min. (Farbe) Druckqualität Bis zu 4.800 x 1.200 dpi, Größe: 460 x 511,25 x 233 mm');
INSERT INTO `fotodrucker` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (3, '../img/products/Fotodrucker/Kodak P210.webp;', 'Kodak P210', 'https://www.amazon.de/Connection-Compatible-Bluetooth-Technology-Lamination/dp/B08FSXD12D/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=2MDJYLK49LMD&keywords=Kodak+P210&qid=1667069875&qu=eyJxc2MiOiIyLjc1IiwicXNhIjoiMi4zNCIsInFzcCI6IjIuMDQifQ%3D%3D&sprefix=hp+envy+inspire+7920e%2Caps%2C87&sr=8-3', '154,99', 4.5, 3227, 0, 'black;KODAK;680 g;Ja;Farbig;Tintenstrahl;Prinics Co., Ltd.;Bluetooth;1 ppm;1 ppm;NIEDRIGE FOTOKOSTEN - Warum mehr fürs Drucken bezahlen? Unser KODAK Mini 2 Retro Fotodrucker ist die günstigste Option, um direkt von zu Hause aus zu drucken. Fotos werden günstiger, wenn sie im Paket mit dem Drucker gekauft werden.|ÜBERRAGENDE FOTOQUALITÄT - KODAK Mini 2 Retro bedient sich der 4PASS-Technologie, um sofort makellose Fotos zu drucken. Jedes Foto wird in einem Laminierverfahren in Schichten aus Farbbändern gedruckt, sodass es vor Fingerabdrücken geschützt und wasserfest ist, um langanhaltende Qualität zu sichern.|ZWEI ARTEN VON FOTOS - Der KODAK Mini 2 Retro Fotodrucker unterstützt sowohl Fotos mit Rand als auch randlose Fotos. Schreiben Sie Ihre Erinnerungen in Fotos mit Rand, damit sie auf ewig erhalten bleiben. Drucken Sie Fotos randlos, um größere Bilder zu erhalten.|Die AR-APP - Laden Sie die KODAK-App für Fotodrucker herunter, um überall und jederzeit zu drucken. Sie können die lustigen Funktionen der erweiterten Realität und andere dekorative Funktionen wie Verschönerung, Filter, Rahmen und mehr verwenden.|KOPMAKTGRÖSSE - Der KODAK Mini 2 Retro Polaroid-Fotodrucker passt direkt in Ihre Hände und Ihre Tasche, um bequem drucken zu können. Dieser tragbare Fotodrucker ist alles, was Sie brauchen, um unvergessliche Erinnerungen mit Ihren Lieben zu schaffen.');
