INSERT INTO `fotodrucker` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (8, '../img/products/Fotodrucker/HP Sprocket Select.webp;', 'HP Sprocket Select', 'https://www.amazon.de/HP-Sprocket-Tragbarer-Sofortbilddrucker-Zink-Papierb%C3%BCndel/dp/B08LNZLQZF/ref=sr_1_2?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=22WUPAI4SN15F&keywords=HP+Sprocket+Select&qid=1667069907&qu=eyJxc2MiOiIzLjg0IiwicXNhIjoiMy4yOCIsInFzcCI6IjIuNTcifQ%3D%3D&sprefix=%2Caps%2C82&sr=8-2', '', 4.4, 65, 0, 'white;HP;1 Pfund;-;Farbig;Zink Technologie;-;Bluetooth;1 ppm;1 ppm;GRÖSSERE FOTOS IN SOFORT - HP Sprocket Select-Drucker drucken in Sekundenschnelle wunderschöne 2,3 x 3,4 Zoll große Fotos von Ihrem Smartphone oder Ihren sozialen Medien. Für iOS und Android Bluetooth 5.1|ZINK ZERO INK TECHNOLOGY - Kein teurer Ersatz für Toner oder Farbbänder! Das glänzende Fotopapier mit klebriger Rückseite enthält innen eingebettete Farben für eine erstaunliche Beständigkeit gegen Wasser, Flecken und Tränen.|EXKLUSIVE RAHMEN &amp; FILTER - Personalisieren Sie Ihre Schnappschüsse mit coolen Bearbeitungstools in der HP App. Schalte Augmented Reality Fun frei oder scanne deine Doodles, um benutzerdefinierte Aufkleber und mehr zu erstellen.|Bundle enthält HP Sprocket Select Drucker mit / Papierpackung (20 Blatt) und Deluxe-Hülle.');
INSERT INTO `fotodrucker` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (9, '../img/products/Fotodrucker/Canon Zoemini.webp;', 'Canon Zoemini', 'https://www.amazon.de/Canon-Fotodrucker-Fotopapier-kabelllos-Smartphone/dp/B0BGT28X1Q/ref=sr_1_2?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1ZHVGRH4B47OJ&keywords=Canon+Zoemini&qid=1667069919&qu=eyJxc2MiOiIzLjg4IiwicXNhIjoiMy42NiIsInFzcCI6IjMuMjEifQ%3D%3D&sprefix=%2Caps%2C66&sr=8-2', '125,00', 0.0, 0, 0, 'white;Canon;177 g;Ja;Farbig;Zink Technologie;Canon;Bluetooth;1 ppm;1 ppm;EXZELLENTE FEATURES - Der Photo Drucker wiegt nur 177g, ist ca. 12x8,4x2,15 cm klein hat 1 Blatt Papiervorrat - der integrierte Akku reicht für ca. 2 Bilder Drucke - ein schnelles Laden des Druckers mit LED Statusanzeige ist über USB-C möglich|PERFEKTE SCHNAPPSCHÜSSE - Mit diesem Photo Printer ohne Tinte kann man von überall unterwegs schnell drucken - in ca. 5 Sekunden sind sofortige Ausdrucke vom Mobilgerät per Bluetooth möglich.|FOTOS ZUM AUFKLEBEN - Mit dem Zink Fotopapier im Format 5 x 7,6 cm mit Kleberückseite abziehbarer Folie können Sie Aufnahmen direkt aufkleben - das Foto Papier ist wasserabweisend, reißfest und ohne Schmierabdrücke|INDIVIDUELL GESTALTBAR - Die Canon Mini Print App bietet trendige Filter, AR-Effekte, Rahmen und Doodles und eine Kachelfunktion für die Erstellung von Postern|LIEFERUMFANG - 1x Canon Zoemini 2 Mobiler Drucker weiß, Kurzanleitung, USB Kabel USB-C auf USB-C , Sicherheitsinformationen, EWS Blatt Canon ZINK Fotopapier 1 Blatt + 1 Smartsheet|177. grams|Welche komponenten sind im lieferumfang des produkts enthaltenen: Canon Zoemini 2 Fotodrucker, Kurzanleitung, USB-Kabel USB-C auf USB-C , Sicherheitsinformationen, EWS Blatt , Canon ZINK Fotopapier 1 Blatt + 1 SMARTSHEET');
